import { Alert } from "react-bs-notifier";
import React from 'react';

export function Error(props) {
    if (props.error) {
        if (props.code === 409) {
            return (
                <div className="inaccu-div">
                    <Alert type="danger" headline="Error">
                        {props.type} Provided email alreday in use.
                    </Alert>
                </div> 
            )
        } 
        else {
            return (
                <div className="inaccu-div">
                    <Alert type="danger" headline="Error">
                        {props.type} Ensure correct credentials are used.
                    </Alert>
                </div>
            )
        }
    }
    else {
        return (<div></div>)
    }
}
